import React from "react";
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { useFormik } from "formik";
function Login() {
  const formik = useFormik({
    initialValues: {
      email: "",
    },

    onSubmit: (values) => {
      alert(JSON.stringify(values, null, 2));
    },
  });
  return (
    <div className="container all-margin-top">
      <div className="mt-5"></div>
      <h1 className="mt-5 mb-3 text-left">
        Login
        <small> Form</small>
      </h1>
      <ol className="breadcrumb">
        <li className="breadcrumb-item active">Login</li>
      </ol>

      <div className="row">
        <div className="col-lg-4 mb-4">
          <form name="sentMessage" id="contactForm" className="text-left" onSubmit={formik.handleSubmit}>
            <div className="control-group form-group">
              <div className="controls">
                <label>Email*</label>
                <input type="email" className="form-control" id="email" onChange={formik.handleChange}

value={formik.values.email}></input>
                <p className="help-block"></p>
              </div>
            </div>
            <div className="control-group form-group">
              <div className="controls">
                <label>Password*</label>
                <input
                  type="password"
                  className="form-control"
                  id="password"
                ></input>
              </div>
            </div>
            <div id="success"></div>

            <button type="submit" className="btn btn-primary" id="login-btn">
              Login
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}
export default Login;
